import React from 'react';

function CaseStudies() {
  return (
    <section>
      <h2 className="text-2xl font-semibold mb-2">Case Highlights</h2>
      <ul className="list-disc ml-6 text-sm text-gray-700">
        <li>EV Routing App: 40% fewer clicks to plan a trip</li>
        <li>Cisco (NDA): Reduced admin dashboard error rates</li>
      </ul>
    </section>
  );
}

export default CaseStudies;
